        <h1>Create a Ticket</h1>
        <form>
            <div className="form-group">
                <label>Title</label>
                <input className="form-control" onChange={(e)=>setTitle(e.value)} value={title}/>
            </div>
            <div className="form-group">
                <label>Price</label>
                <input className="form-control" onChange={(e)=>setTitle(e.value)} value={title}/>
